import React, { Component } from "react";
import props from "./props";
class Classcompstate extends Component{
    state={
        name:"sankar"
    }
    render(){
        return(
            <div>
                <h1>this is state in class component  str={this.state.name}</h1>
                <props/>
            </div>
        )
    }
}
export default Classcompstate
